import React from 'react';
import { Box, Heading } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>
      <Box>
        <Heading>Find places to eat in:</Heading>
      </Box>
      <Box>
        <Heading>{props.location}</Heading>
      </Box>
    </React.Fragment>
  )
}

export default landing;
